import React from 'react';
import "./coldChainWar.css";
import blueLogo from "./blueLogo.png"
import Nav from '../landingPage/Nav/navbar.js'




const ColdChainWar = () => {
	return(
		<div className=" navCont flex">

			<div className="bg-light-green ">	
				<Nav />
	      	</div>
	      	<img className="bLogo grow" src={blueLogo} alt="logo" />


      	</div>
		)
}

export default ColdChainWar;
